INSERT INTO `marker_tab` VALUES (39,21,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/e/e3/BotW_Eastern_Abbey_Guardian.png&quot;&gt;Guardians are ancient machines with a cephalopodic design based on Octoroks.[1] They are powerful enemies, with high health and a laser beam attack that deals six Hearts of damage. If a target is too close to them, they will attempt to distance themselves in order to fire their lasers.',1,0);
INSERT INTO `marker_tab` VALUES (40,21,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/e/e3/BotW_Eastern_Abbey_Guardian.png&quot; width=&#039;100%&#039;&gt;Guardians are ancient machines with a cephalopodic design based on Octoroks.[1] They are powerful enemies, with high health and a laser beam attack that deals six Hearts of damage. If a target is too close to them, they will attempt to distance themselves in order to fire their lasers.',1,0);
INSERT INTO `marker_tab` VALUES (41,21,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/e/e3/BotW_Eastern_Abbey_Guardian.png&quot; width=&#039;100%&#039;&gt;Guardians are ancient machines with a cephalopodic design based on Octoroks.[1] They are powerful enemies, with high health and a laser beam attack that deals six Hearts of damage. If a target is too close to them, they will attempt to distance themselves in order to fire their lasers.',1,0);
INSERT INTO `marker_tab` VALUES (42,22,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/2/22/BotW_Temple_of_Time.png&quot; width=&quot;100%&quot;&gt;In Breath of the Wild, the Temple of Time is located in the Great Plateau in Central Hyrule, close to the Shrine of Resurrection. The temple can be seen in an extremely dilapidated state, with missing and broken windows, crumbling rooftop, and collapsed walls. Rubble is strewn around the temple&#039;s interior and the structure appears to have been reclaimed by nature as grass can be seen growing inside and ivy creeps up the walls.',1,0);
INSERT INTO `marker_tab` VALUES (43,23,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/0/00/BotW_Shrine_of_Resurrection.png&quot; width=&quot;100%&quot;&gt;Link awakens from within the Shrine of Resurrection after hearing the call of an unknown voice. He is guided to a pedestal, where he receives the Sheikah Slate. Afterwards, the door to the chamber opens, leading to another room containing two Treasure Chests with the Old Shirt and the Well-Worn Trousers. Behind the Chests rests a pedestal from which Link can place the Sheikah Slate and open the entrance to the Shrine of Resurrection, leading to the Great Plateau.',1,0);
INSERT INTO `marker_tab` VALUES (44,22,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/2/22/BotW_Temple_of_Time.png&quot; width=&quot;100%&quot;&gt;\r\n&lt;p&gt;In Breath of the Wild, the Temple of Time is located in the Great Plateau in Central Hyrule, close to the Shrine of Resurrection. The temple can be seen in an extremely dilapidated state, with missing and broken windows, crumbling rooftop, and collapsed walls. Rubble is strewn around the temple&#039;s interior and the structure appears to have been reclaimed by nature as grass can be seen growing inside and ivy creeps up the walls.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (45,21,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/e/e3/BotW_Eastern_Abbey_Guardian.png&quot; width=&#039;100%&#039;&gt;\r\n&lt;p&gt;Guardians are ancient machines with a cephalopodic design based on Octoroks.[1] They are powerful enemies, with high health and a laser beam attack that deals six Hearts of damage. If a target is too close to them, they will attempt to distance themselves in order to fire their lasers.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (46,23,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/0/00/BotW_Shrine_of_Resurrection.png&quot; width=&quot;100%&quot;&gt;&lt;p&gt;Link awakens from within the Shrine of Resurrection after hearing the call of an unknown voice. He is guided to a pedestal, where he receives the Sheikah Slate. Afterwards, the door to the chamber opens, leading to another room containing two Treasure Chests with the Old Shirt and the Well-Worn Trousers. Behind the Chests rests a pedestal from which Link can place the Sheikah Slate and open the entrance to the Shrine of Resurrection, leading to the Great Plateau.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (47,24,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/6/64/BotW_Oman_Au_Shrine_Exterior.png&quot; width=&quot;100%&quot;&gt;\r\n&lt;p&gt;After Link activates the Sheikah Towers, he is greeted by the Old Man who directs him to the Oman Au Shrine, promising to trade his Paraglider in exchange for the treasure resting inside. It can only be opened by pressing the Sheikah Slate onto a pedestal near the entrance to the Shrine.&lt;/p&gt;',1,0);
INSERT INTO `marker_tab` VALUES (48,24,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/6/64/BotW_Oman_Au_Shrine_Exterior.png&quot; width=&quot;100%&quot;&gt;\r\n&lt;p&gt;A lone pedestal rests inside the Oman Au Shrine, from which Link can receive the Magnesis Rune for the Sheikah Slate, allowing him to move metallic objects magnetically. Throughout the Shrine, there are several metallic slabs which Link must move to proceed. A metallic Treasure Chest sits upon a platform along the left-hand wall, which can be brought closer to obtain the Traveler&#039;s Bow inside.&lt;/p&gt;\r\n&lt;p&gt;At the end of the Shrine, the Monk Oman Au waits for Link to complete his trial, and presents him with a Spirit Orb.&lt;/p&gt;',1,0);
INSERT INTO `marker_tab` VALUES (49,25,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/e/e3/BotW_Eastern_Abbey_Guardian.png&quot; width=&#039;100%&#039;&gt;\r\n&lt;p&gt;Guardians are ancient machines with a cephalopodic design based on Octoroks.[1] They are powerful enemies, with high health and a laser beam attack that deals six Hearts of damage. If a target is too close to them, they will attempt to distance themselves in order to fire their lasers.&lt;/p&gt;',1,1);
