INSERT INTO `marker_tab` VALUES (55,24,1,1,'','&lt;img src=&quot;https://zeldawiki.org/images/6/64/BotW_Oman_Au_Shrine_Exterior.png&quot; width=&quot;100%&quot;&gt;\r\n&lt;p&gt;After Link activates the Sheikah Towers, he is greeted by the Old Man who directs him to the Oman Au Shrine, promising to trade his Paraglider in exchange for the treasure resting inside. It can only be opened by pressing the Sheikah Slate onto a pedestal near the entrance to the Shrine.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (56,24,1,1,'','&lt;img src=&quot;http://zeldauniverse.net/wp-content/uploads/2016/06/guide-botw-ch2-02.jpg&quot; width=&quot;100%&quot;&gt;&lt;p&gt;Activate Magnesis and look around the room for metallic objects. Use Magnesis to lift the metallic plates in the center of the room to reveal a hidden passage.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (57,24,1,1,'','&lt;img src=&quot;http://zeldauniverse.net/wp-content/uploads/2016/06/guide-botw-ch2-03.jpg&quot; width=&quot;100%&quot;&gt;&lt;p&gt;Climb down the ladder and run through the hidden passage. Climb the stairs at the end of the passage.&lt;/p&gt;',1,1);
