INSERT INTO `marker_tab` VALUES (187,172,1,9,'','&lt;p&gt;&lt;em&gt;There are two acorns in this location.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Description:&lt;/strong&gt;&amp;nbsp;Often found on the ground near trees. Squirrels adore this nut, so you may have competition while foraging. Add one to a meal for a nutty seasoning.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Additional Uses:&amp;nbsp;&lt;/strong&gt;Restores 1&amp;nbsp;and 1/4 &amp;nbsp;Hearts&lt;/p&gt;',1,1);
