INSERT INTO `marker_tab` VALUES (192,201,1,9,'','&lt;p&gt;&lt;strong&gt;Description:&amp;nbsp;&lt;/strong&gt;A butterfly found in the woods and plains of warm regions. Its wings absorb the warmth of the sun. Cook it with monster parts to create an elixir that makes you feel warm and fuzzy.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (193,155,1,9,'','&lt;p&gt;&lt;em&gt;There are 3 Hylian Shrooms in this location.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Description:&amp;nbsp;&lt;/strong&gt;A common mushroom found near trees around Hyrule. Eat it to restore half a heart.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Effect:&amp;nbsp;&lt;/strong&gt;&lt;img src=&quot;https://zeldawiki.org/images/7/76/BotW_Half-Heart_Icon.png&quot; alt=&quot;&quot; width=&quot;18&quot; height=&quot;14&quot; /&gt;&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (194,173,1,9,'','&lt;p&gt;&lt;em&gt;There is one&amp;nbsp;Shroom is located at the base of a tree.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Description&lt;/strong&gt;:&amp;nbsp;A common mushroom found near trees around Hyrule. Eat it to restore half a heart.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Effect:&amp;nbsp;&lt;img src=&quot;https://zeldawiki.org/images/7/76/BotW_Half-Heart_Icon.png&quot; alt=&quot;&quot; width=&quot;18&quot; height=&quot;14&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (195,177,1,9,'','&lt;p&gt;&lt;em&gt;There are 2 Hearty Truffles located inside a hollow stump.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Description&lt;/strong&gt;: This rare mushroom has a rich scent. Cook it before eating to temporarily increase your maximum hearts.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;strong&gt;Additional Uses&lt;/strong&gt;: Restores 2 hearts.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (196,162,1,9,'','&lt;p&gt;&lt;em&gt;There is a Stamella Shroom located underneath the tree fort.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Description:&amp;nbsp;&lt;/strong&gt;A green mushroom that grows near trees in the forest. It&#039;s chock-full of natural energy. Cook it to release its stamina-restoration properties.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Additional Uses:&amp;nbsp;&lt;/strong&gt;Restores one heart.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (197,212,1,9,'','&lt;p&gt;&lt;em&gt;There are 4 Rushrooms in this location. They can be found dotted on the cliff side.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Description:&amp;nbsp;&lt;/strong&gt;A mushroom that can grow almost anywhere but prefers ceilings and sheer cliffs. Cook it before eating to temporarily increase your movement speed.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Additional Uses:&amp;nbsp;&lt;/strong&gt;Restores half a heart.&amp;nbsp;&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (198,124,1,9,'','&lt;p&gt;&lt;strong&gt;Description:&amp;nbsp;&lt;/strong&gt;A green mushroom that grows near trees in the forest. It&#039;s chock-full of natural energy. Cook it to release its stamina-restoration properties.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Additional Uses:&amp;nbsp;&lt;/strong&gt;Restores 1 Heart.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (199,121,1,9,'','&lt;p&gt;&lt;strong&gt;Description:&amp;nbsp;&lt;/strong&gt;A rare yellowish-orange mushroom. Cook it before eating to temporarily increase your stamina limit.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Additional Uses:&amp;nbsp;&lt;/strong&gt;Restores 1 Heart.&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (200,96,1,9,'','&lt;p&gt;&lt;em&gt;There are 2 Endura Shrooms in this location.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Description:&amp;nbsp;&lt;/strong&gt;A rare yellowish-orange mushroom. Cook it before eating to temporarily increase your stamina limit.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Additional Uses:&amp;nbsp;&lt;/strong&gt;Restores 1 Heart.&lt;/p&gt;',1,0);
