INSERT INTO `marker_tab` VALUES (205,215,1,9,'','&lt;p&gt;&lt;em&gt;The Fire Arrows can be located inside a Treasure Chest in the Bokoblin Camp. The Fire Arrows may only be aquired after all the Bokoblins have been defeated, thus unlocking the chest.&lt;/em&gt;&lt;/p&gt;',1,1);
INSERT INTO `marker_tab` VALUES (206,229,1,7,'','&lt;p&gt;When Link encounters a Korok, it believes it has been found by Hestu before realizing that Link is not Hestu. The Korok will then give Link a Korok Seed, asking him to return it to Hestu.&lt;/p&gt;\r\n&lt;p&gt;Upon finding Hestu, Link will discover that his Maracas were stolen from him by his fellow Koroks as part of a prank. Talking to him will trigger The Priceless Maracas Side Quest, in which Link will have to retrieve his Maracas from a chest in a nearby enemy camp. Once he returns his Maracas to him, Hestu will find out that the Korok Seeds inside the Maracas are gone. Hestu will then tell Link that if Hestu had a Koroko Seed, he would be able to sing, dance and use his powers to expand Link&#039;s Inventory. Hestu can upgrade Link&#039;s Weapon Stash, Bow Stash, or Shield Stash.&lt;/p&gt;\r\n&lt;p&gt;&lt;a title=&quot;Learn more about Hestu&amp;nbsp;at Zelda Wiki&quot; href=&quot;https://zeldawiki.org/Hestu&quot;&gt;Learn more about Hestu&amp;nbsp;at Zelda Wiki&lt;/a&gt;&lt;br /&gt;&lt;a title=&quot;Korok Seed Inventory Upgrades Guide&quot; href=&quot;http://zeldauniverse.net/guides/breath-of-the-wild/sidequests/korok-seed-inventory-upgrades/&quot;&gt;Korok Seed Inventory Upgrades Guide&lt;/a&gt;&lt;/p&gt;',1,0);
